import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './index.css';

ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <App />
    <h1>Оптимізувати, видалити не потрібне, довести дизайн до ума</h1>
  </React.StrictMode>,
);
